import React from 'react';
import './App.css';
import AppBar from '@material-ui/core/AppBar';
import TextField from '@material-ui/core/TextField';
import {BrowserRouter as Router, Link, Route} from 'react-router-dom'

import DungeonInfo from './components/DungeonInfo'

function App() {
  return (
    <div className="app">
      <Router>
        <div className="header-bar">
          <AppBar className="header-bar" style={{"background-color":"#272e2b"}}>
            <div className="header-title"> Puzzle and Dungeons </div>
          </AppBar>
        </div>
        <div className="body">
            <div className="body-center">
              <div className="title">
                Puzzle and Dungeons
              </div>
              <TextField className="search-field" hintText="Hint Text" />

            </div>

        </div>
        <Route path="/dungeon" component={DungeonInfo}/>
      </Router>
    </div>
  );
}

export default App;
